}


function build_house_up(x_corner, y_corner){

  let h_house=10     // actually 12  
  let w_house=16     // actually 16 
  let w_wall=2
  let w_door=4      //w_house-w_door  should be even

  let l_front_wall=Math.floor((w_house-w_door)/2)



  let wall00=new Wall(x_corner, y_corner, w_house, w_wall)   // bottom wall

  let wall01=new Wall(x_corner, y_corner-(h_house-w_wall), w_wall, h_house-w_wall)  //side wall
  let wall02=new Wall(x_corner+(w_house-w_wall), y_corner-(h_house-w_wall), w_wall, h_house-w_wall)   //side wall

  let wall03=new Wall(x_corner, y_corner-(h_house-w_wall)-w_wall, l_front_wall, w_wall)    //top wall 1  doorway gap
  let wall04=new Wall(x_corner+h_house, y_corner-(h_house-w_wall)-w_wall, l_front_wall, w_wall)    //top wall 2  doorway gap

  walls.push(wall00)
  walls.push(wall01)
  walls.push(wall02)
  walls.push(wall03)
  walls.push(wall04)

  let new_house=new House(x_corner,y_corner)
