// classes
class Paddle {
  constructor(x, y, w) {
    this.xPos=x
    this.yPos=y
    this.width=w
  }

  draw() {
      setDrawColorRGBA(198, 0, 0)
      drawRect(this.xPos, this.yPos, 1, 1);
  }

  update(){
    if(moving==true){
      //wall detection variable reset
      wall2left=false
      wall2right=false
      wall2up=false
      wall2down=false

      if(direction=="left"){
        next_x=this.xPos-1
        next_2x=this.xPos-2
        if(next_x<0){
          next_x=next_x+feature.screenWidth
        }
        if(next_2x<0){
          next_2x=next_2x+feature.screenWidth
        }
        next_y=this.yPos
        for(let i=0; i<walls.length; i++){
          let wall2check=walls[i]
          if(holding_item==false){
            if (next_x>=wall2check.x && next_x<wall2check.x+wall2check.width && next_y>=wall2check.y && next_y<wall2check.y+wall2check.height){
              wall2left=true
            }
          }else{
            if (next_2x>=wall2check.x && next_2x<wall2check.x+wall2check.width && next_y>=wall2check.y && next_y<wall2check.y+wall2check.height){
              wall2left=true
            }
          }
        }
        if(wall2left==false){
          this.xPos=next_x
          draw_level01()
        }else{
          moving=false
        }
      }else if(direction=="right"){
        next_x=(this.xPos+1)%feature.screenWidth
        next_2x=(this.xPos+2)%feature.screenWidth
        next_y=this.yPos
        for(let i=0; i<walls.length; i++){
          let wall2check=walls[i]
          if(holding_item==false){
            if (next_x>=wall2check.x && next_x<wall2check.x+wall2check.width && next_y>=wall2check.y && next_y<wall2check.y+wall2check.height){
                wall2right=true
            }
          }else{
            if (next_2x>=wall2check.x && next_2x<wall2check.x+wall2check.width && next_y>=wall2check.y && next_y<wall2check.y+wall2check.height){
                wall2right=true
            }
          }
        }
        if(wall2right==false){
          this.xPos=next_x
          draw_level01()
        }else{
          moving=false
        }
      }else if(direction=="up"){
        next_x=this.xPos
        next_y=this.yPos-1
        next_2y=this.yPos-2
        if(next_y<0){
          next_y=next_y+feature.screenHeight
        }
        for(let i=0; i<walls.length; i++){
          let wall2check=walls[i]
          if(holding_item==false){
            if (next_x>=wall2check.x && next_x<wall2check.x+wall2check.width && next_y>=wall2check.y && next_y<wall2check.y+wall2check.height){
                wall2up=true
            }
          }else{
            if (next_x>=wall2check.x && next_x<wall2check.x+wall2check.width && next_2y>=wall2check.y && next_2y<wall2check.y+wall2check.height){
                wall2up=true
            }
          }
        }
        if(wall2up==false){
          this.yPos=next_y
          draw_level01()
        }else{
          moving=false
        }
      }else if(direction=="down"){
        next_x=this.xPos
        next_y=(this.yPos+1)%feature.screenHeight
        next_2y=(this.yPos+2)%feature.screenHeight
        for(let i=0; i<walls.length; i++){
          let wall2check=walls[i]
          if(holding_item==false){
            if (next_x>=wall2check.x && next_x<wall2check.x+wall2check.width && next_y>=wall2check.y && next_y<wall2check.y+wall2check.height){
                wall2down=true
             }
          }else{
            if (next_x>=wall2check.x && next_x<wall2check.x+wall2check.width && next_2y>=wall2check.y && next_2y<wall2check.y+wall2check.height){
                wall2down=true
             }
          }
        }
        if(wall2down==false){
          this.yPos=next_y
          draw_level01()
        }else{
          moving=false
        }
      }
    }

    //monitor touching banana if not holding item

    if(holding_item==false){
      for(let i=0; i<bananas.length; i++){
        let banana2check=bananas[i]
        if(this.xPos==banana2check.x && this.yPos==banana2check.y){
          banana2check.picked_up=true
          banana2check.in_house=false
          holding_item=true
        }
      }
    }



  }
}


